(62,NULL,NULL,NULL,2575,'Bug fixed  - jqueryFIleTree fix','In 5.1.9 this is not included so you cannot edit module files on the dashboard.\r\n\r\nAdd the folder jquery.fileTree in asset->plugins->bower_components\r\nThen replace the following code in two files:\r\nviews/sximo/code/index.blade.php and \r\nviews/sximo/module/code/code.blade.php\r\n<pre>\r\n	<!-- N.R. jqueryFileTree fix -->\r\n	<script type=\"text/javascript\" src=\"{{ asset(\'assets/plugins/bower_components/jquery.fileTree/jqueryFileTree.js\') }}\"></script>\r\n	<link href=\"{{ asset(\'assets/plugins/bower_components/jquery.fileTree/jqueryFileTree.css\') }}\" rel=\"stylesheet\">\r\n	<!-- end -->\r\n</pre>',NULL,'low','Completed',NULL,'2017-05-12 09:41:53',NULL),
