(319,NULL,NULL,NULL,3901,'BUG FILTER SEARCHING','* struktur database saya :\ntb_ceklist :\n- id\n- jabatan\n- ceklist\n\n* Di menu control panel -> bangun kode -> perbaharui -> form dan kolom searchable yang di centang hanya kolom jabatan lalu di klik save change.\n* Jika query pencarian di database dengan kondisi like di jabatan atau like ceklist maka total 44\n* Jika query pencarian di database dengan kondisi like di jabatan maka total 16\n* Kenapa Ketika di lakukan pencarian dengan pencarian 15 yang muncul totalnya 44 data seharusnya 16 data  karena di menu superadmin yang di centang searchable hanya kolom jabatan\n\nMohon bantuannya untuk solusinya. Terima kasih',NULL,'low','New',NULL,'2018-09-25 09:36:17',NULL),
(320,NULL,NULL,NULL,3901,'Bug Join','* struktur database saya :\ntb_ceklist :\n- id\n- jabatan\n- ceklist\n\ntb_mst_ceklist :\n- id_mst_ceklist\n- nama_mst_ceklist\n\njoin :\n- Master table : tb_mst_ceklist\n- Join Table : tb_ceklist\n- Master key : id_mst_ceklist\n- Joined key : ceklist\n\n\n* Di menu control panel -> bangun kode -> perbaharui -> SQL dilakukan joint antara table tb_ceklist dengan tb_mst_ceklist\n* Lalu di tab table yang di centang kolom jabatan dan nama_mst_ceklist\n* Kenapa di tab Form tidak muncul kolom yang telah di joint sebagaimana yg terdapat di tab table ? Bagaimana filter pencarian ketika akan di lakukan pencarian filter\n* Di table datatable kenapa yg muncul hanya kolom jabatan, padahal di tab Table saya mencentang 2 kolom yaitu kolom jabatan dan nama_mst_ceklist \n* Bagaimana caranya agar ketika di filter search bisa berdasarkan kolom join yang di centang di superadmin control panel -> bangun kode -> perbaharui -> Form',NULL,'low','New',NULL,'2018-09-25 09:39:26',NULL),
